import React from 'react';
import './css/AboutMe.css';

class AboutMe extends React.Component {
  render () {
    return (
      <div className="background">
        <div className="hero-text">
          <h1>David Mah</h1>
          <p>Software Engineer</p>
        </div>
      </div> 
    )
  }
}

export default AboutMe;
